import { useAuth } from "../context/AuthContext";

export default function Profile() {
  const auth = useAuth();

  if (!auth || !auth.user) {
    return <div style={{ padding: 40 }}>Not logged in.</div>;
  }

  const { user } = auth;

  return (
    <div style={{ padding: 40 }}>
      <h1>Profile</h1>
      <p>Email: {user.email}</p>
      <p>User ID: {user.uid}</p>
    </div>
  );
}
